var tipuesearch = {"pages": [{'title': '40823121', 'text': '\n', 'tags': '', 'url': '40823121.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數. \n', 'tags': '', 'url': 'Develop.html'}, {'title': 'homework', 'text': '', 'tags': '', 'url': 'homework.html'}, {'title': 'w1', 'text': '\n', 'tags': '', 'url': 'w1.html'}, {'title': 'w2~w4', 'text': '\n \n \n \n \n \n \n \n', 'tags': '', 'url': 'w2~w4.html'}, {'title': 'W5', 'text': '什麼是API? \n API 是 應用程式介面\xa0\xa0 \n 可以幫助開發者節省精力，並很快的達到目的。舉個例子，假日出去玩總是玩到很累，肚子餓，讓人很想去飲料販賣機買麵包來吃。現在你面前有一台飲料販賣機，接下來你會這麼做： \n \n 你想吃麵包 \n 你按了販賣機上的麵包按鈕 \n 你從取物口拿出麵包\xa0 \n \n API 的概念-剛剛例子中的麵包就是「你想取得的資料」。而販賣機上的按鈕就是 API ，按下去販賣機就收到了你的需求，並將麵包從取物口送出，你也就得到了你想要的資料了。 \n \n', 'tags': '', 'url': 'W5.html'}, {'title': 'W6', 'text': '', 'tags': '', 'url': 'W6.html'}, {'title': 'W7', 'text': '工程師 \n \n 下載 cad2020_w7_tcc_gnuplot.7z解壓縮到隨身碟資料夾裡 \n', 'tags': '', 'url': 'W7.html'}, {'title': 'w8', 'text': '下載\xa0 Pyslvs_UI \n Pyslvs 使用手冊 \n Pyslvs連桿機構運用 \n \n \n', 'tags': '', 'url': 'w8.html'}]};